import React from 'react'
import styled from "styled-components"

const HeaderContainer = styled.div`
        
    height: 100px;
    display: flex;
`

const Header = () => {
    return (
        <HeaderContainer>
            <h1>Astromatch</h1>
        </HeaderContainer>
    )

}

export default Header
